import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Sidebar from './component/Sidebar';
import Header from './component/Header';
import NavigationBar from './component/NavigationBar';
import Notifications2 from './component/Notifications2';
import Chats from './component/Chats';
import AddButton from './component/AddButton'; // Import the AddButton component

const App: React.FC = () => {
  return (
    <Router>
      <div className="flex flex-col bg-[#FBFBFB]">
        <Header />
        <div className="flex flex-1">
          <Sidebar />
          <main className="flex-1 p-4 ml-48 mt-[4rem] fixed w-full overflow-hidden">
            <div className="flex flex-col">
              <div className="flex mt-5">
                <NavigationBar />
              </div>
              <div className="mt-7">
                <Notifications2 />
              </div>
              <div className="mt-10"> {/* Adjusted margin-top for spacing */}
                <AddButton /> {/* Add the AddButton component here */}
              </div>
              <div className="mt-3">
                <Chats/>
              </div>
            </div>
          </main>
        </div>
      </div>
    </Router>
  );
};

export default App;
